	ChStr.isGb = function(ch){
		return ChStr.gb2312.indexOf(ch) >= 0;
	}
	ChStr.isGbk = function(ch){
		return Boolean(ch.match(/[\u4e00-\u9fa5]/g) && ChStr.gb2312.indexOf(ch) < 0);
	}
	
	ChStr.getChCode = function(ch) {
		if(!ch || ch.length > 1 || !ChStr.isGb(ch)){
			return null;
		}
		var index = ChStr.sgCode.indexOf(ch);
		var code = "";
		for(var i = index; i >= 0; i--){
			var c = ChStr.sgCode.charAt(i);
			if(c == "|")break;
			code = c + code;
		}
		return code.substr(0,2);
	}
	
	ChStr.getTermCode = function(term){
		if(!term || term.length > 20 || term.length == 1){
			return null;
		}
		var codes = new Array();
		var res = "";
		for(var ch of term){
			var code = ChStr.getChCode(ch);
			if(!code)return null;
			codes.push(code);
		}
	
		switch(codes.length){
			case 2: 
				res = codes[0] + codes[1];
				break;
			case 3: 
				res = codes[0].charAt(0) + codes[1].charAt(0) + codes[2];
				break;
			default:
				res = codes[0].charAt(0) + codes[1].charAt(0) + codes[2].charAt(0) + codes[codes.length-1].charAt(0);
				break;
		}
		return res;
	}
	
	ChStr.getMuchCodes = function(text){
		var tArr = text.split("\n");
		var res = new Array();
		for(var str of tArr){
			str = str.replace(/\s/g, "");
			if(str.match(/^#.{1,20}\|[a-z]{0,4}/g)){
				str = str.replace(/#/g, "");
				str = str.replace(/\|/g, "\t");
				res.push(str);
				continue;
			}
			var cd = ChStr.getTermCode(str);
			if(cd){
				res.push(str + "\t" + cd);
			}
		}
		return res.join("\n");
	}
